  const [lobbyName] = useState(useParams().lobbyName);
  const socket = useRef(establishIoConnection(window.location.pathname));
  return (
    <div>
      <h3>{lobbyName}</h3>
      <SetUser socket={socket.current} />
      {<ChatRoom socket={socket.current} />}
    </div>
  );
}

export default GameLobby;

